import actionTypes from '../actionTypes'

const initialState = {
    userName: ''
}

const calReducer = (state = initialState, action) => {
    let userName = state.userName;
    switch (action.type) {
        case actionTypes.FEATCH_USER_NAME_OK:
            return { ...state, userName:action.data["usernameName"] };
        default:
            return state;
    }
}

export default calReducer;
